import React, { Component } from 'react';


class FormLogin extends Component {

    render() {
        return (
            <div className="shadow p-3 px-md-4 bg-white rounded ">
                <form>
                    <div className="form-group">
                        <label>Usuario</label>
                        <input type="text" class="form-control" placeholder="Ingrese usuario"></input>
                    </div>
                    <div className="form-group">
                        <label>Contrase√±a</label>
                        <input type="password" class="form-control" placeholder="Ingrese usuario"></input>
                    </div>

                    <div className="form-group">
                        <button type="button" class="btn btn-primary btn-lg">Entrar</button>
                    </div>

                </form>
            </div>
        )
    };
}

export default FormLogin;
